import React, {Component} from "react";

class App extends Component{
    constructor(){
        super()
        this.state = {
            isLoggedIn: false,
        }
    }

    render(){
        let word;
        if(this.state.isLoggedIn){
            word = "in";
        } else {
            word = "out";
        }
        return(
            <div>
                <h1>
                    You are currently logged
                </h1>
                <h3>
                    {word}
                </h3>
            </div>
        )
    }
}

export default App;
